import {images} from "./Images";
import {gradient, methodoColors} from "./Colors";

export const Sketch = {
    title: "Sketch",
    logo: images.Sketch,
    color: methodoColors.Sketch,
    gradient: gradient.BrandSketch30,
}
export const Sass = {
    title: "Sass",
    logo: images.Sass,
    color: methodoColors.Sass,
    gradient: gradient.BrandSass30,
}
